import React, { useState, useEffect } from "react";

const Item = ({ task }) => {
  const handleClick = (e) => {
    e.preventDefault();
  };

  return (
    <div>
      <p>{task}</p>
      <button onClick={(e) => handleClick(e)}>Delete</button>
    </div>
  );
};

export default Item;
